s and portion sizes on children's health.\\n\\nBeing a parent is the most important journey of your life, but the trouble is no one gives you a map – until now. Jo Frost, Britain’s best known parenting expert, returns with a new series providing mums and dads with the honest, insightful, no-nonsense advice they need.\\n\\nJo talks to Britain’s parents to find out which issues are really worrying them, whether it’s how many hours their children play computer games or how much exercise they’re getting. In each show she sets out to answer these most pressing of parental questions with a large-scale demonstration involving kids and parents, aiming to debunk myths and reveal crucial facts such as how much children should eat, how many hours of sleep they really need; and the truth about just how young girls are when they start to obsess about their bodies.\\n\\nIn each programme Jo also meets two families suffering from severe versions of the kinds of problems everyone worries about, from a seven-year-old boy who only eats bread and butter to a ten year old so addicted to computer games he spends up to 80 hours a week at the screen.\\n\\nReal Families is the new home for captivating and interesting documentaries and shows about all things parenting. We will be uploading every week so subscribe to keep updated.\\n\\nSubscribe for more from Real Families: https:\/\/goo.gl\/y8WzCa\\n\\nContent licensed from DRG.\\n\\nProduced by Outline.\",\"isCrawlable\":true,\"thumbnail\":{\"thumbnails\":[{\"url\":\"https:\/\/i.ytimg.com\/vi\/2fC48xMdrjU\/hqdefault.jpg?sqp=-oaymwEiCKgBEF5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\\u0026rs=AOn4CLCW6OVTnWhwNdQkxRiHnQg46od_kg\",\"width\":168,\"height\":94},{\"url\":\"https:\/\/i.ytimg.com\/vi\/2fC48xMdrjU\/hqdefault.jpg?sqp=-oaymwEiCMQBEG5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\\u0026rs=AOn4CLAg0oLiZA-t7YBsul1P7qsZSGKcdg\",\"width\":196,\"height\":110},{\"url\":\"https:\/\/i.ytimg.com\/vi\/2fC48xMdrjU\/hqdefault.jpg?sqp=-oaymwEjCPYBEIoBSFry s six-year-old Paige who has never slept a full night in her own bed;. with the number of obese 6-year-olds doubling over the last ten years, Jo works to discover the impact of calories and portion sizes on children's health.\n\nBeing a parent is the most important journey of your life, but the trouble is no one gives you a map – until now. Jo Frost, Britain’s best known parenting expert, returns with a new series providing mums and dads with the honest, insightful, no-nonsense advice they need.\n\nJo talks to Britain’s parents to find out which issues are really worrying them, whether it’s how many hours their children play computer games or how much exercise they’re getting. In each show she sets out to answer these most pressing of parental questions with a large-scale demonstration involving kids and parents, aiming to debunk myths and reveal crucial facts such as how much children should eat, how many hours of sleep they really need; and the truth about just how young girls are when they start to obsess about their bodies.\n\nIn each programme Jo also meets two families suffering from severe versions of the kinds of problems everyone worries about, from a seven-year-old boy who only eats bread and butter to a ten year old so addicted to computer games he spends up to 80 hours a week at the screen.\n\nReal Families is the new home for captivating and interesting documentaries and shows about all things parenting. We will be uploading every week so subscribe to keep updated.\n\nSubscribe for more from Real Families: "},{"text":"https://goo.gl/y8WzCa","navigationEndpoint":{"clickTrackingParams":"CJYBEM2rARgBIhMI0-X1xoqT6gIVBo5VCh3ZTANOSLXc9pixnq742QE=","commandMetadata":{"webCommandMetadata":{"url":"/redirect?event=video_description\u0026v=2fC48xMdrjU\u0026redir_token=iO-UBOPyLZhAaHqUMof3dia6elR8MTU5MjgzNDkwNUAxNTkyNzQ4NTA1\u0026q=https%3A%2F%2Fgoo.gl%2Fy8WzCa","rootVe":83769}},"urlEndpoint":{"url":"/redirect?event=video_description\u0026v=2fC48xMdrjU\u0026redir_t
